def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    clauses = []
    subject = triples[0].subject
    clauses.append(subject)

    for triple in triples:
        predicate = triple.predicate
        obj = triple.object
        if predicate == "cityServed":
            clauses.append(f"serves {obj}")
        elif predicate == "country":
            clauses.append(f"is located in {obj}")
        elif predicate == "capital":
            clauses.append(f"has {obj} as its capital")
        elif predicate == "elevationAboveTheSeaLevel":
            clauses.append(f"has an elevation of {obj} meters")
        elif predicate == "location":
            clauses.append(f"is located in {obj}")
        elif predicate == "operatingOrganisation":
            clauses.append(f"is operated by {obj}")
        elif predicate == "runwayLength":
            clauses.append(f"has a runway length of {obj} meters")
        elif predicate == "runwayName":
            clauses.append(f"has runway {obj}")
        elif predicate == "isPartOf":
            clauses.append(f"is part of {obj}")
        elif predicate == "1stRunwayLengthFeet":
            clauses.append(f"has a first runway length of {obj} feet")
        elif predicate == "1stRunwaySurfaceType":
            clauses.append(f"has a first runway surface of {obj}")
        elif predicate == "3rdRunwayLengthFeet":
            clauses.append(f"has a third runway length of {obj} feet")
        elif predicate == "icaoLocationIdentifier":
            clauses.append(f"has ICAO identifier {obj}")
        elif predicate == "locationIdentifier":
            clauses.append(f"has location identifier {obj}")
        elif predicate == "elevationAboveTheSeaLevelInFeet":
            clauses.append(f"has an elevation of {obj} feet")
        elif predicate == "iataLocationIdentifier":
            clauses.append(f"has IATA identifier {obj}")
        elif predicate == "nativeName":
            clauses.append(f"is also known as {obj}")
        elif predicate == "leaderParty":
            clauses.append(f"is led by {obj}")
        elif predicate == "language":
            clauses.append(f"speaks {obj}")
        elif predicate == "owner":
            clauses.append(f"is owned by {obj}")
        elif predicate == "1stRunwayLengthMetre":
            clauses.append(f"has a first runway length of {obj} meters")
        elif predicate == "4thRunwaySurfaceType":
            clauses.append(f"has a fourth runway surface of {obj}")
        elif predicate == "largestCity":
            clauses.append(f"has {obj} as its largest city")
        elif predicate == "4thRunwayLengthFeet":
            clauses.append(f"has a fourth runway length of {obj} feet")
        elif predicate == "elevationAboveTheSeaLevelInMetres":
            clauses.append(f"has an elevation of {obj} meters")
