            clauses.append(f"has {obj} as its official language")
        elif predicate == "regionServed":
            clauses.append(f"serves the region of {obj}")
        else:
            clauses.append(f"{predicate} is {obj}")

    sentence = ", ".join(clauses) + "."
    return sentence

